import './ExpenseItem.css';

export default function ExpenseItem(props){

    return (
        <div className="expense__item">
            <div><ExpenseDate date={props.expense.date}/></div>
            <div className="className="expense-item__description>
                <h2>{props.expense.title}</h2>
            </div>
            <div className="className="expense-item__price>${props.expense.amount}</div>
        </div>
    )
}
